const AdminProductCard = ({product}) => {
    
  return (
    <div className="AdminProductCardWrapper">
        <div className="AdminProductCardImage"></div>
        <div className="AdminProductCardTitle"></div>
        <div className="AdminProductCardPrice"></div>
        <div className="AdminProductCardQuantity"></div>
        
        <div className="AdminProductCardCategory"></div>      
    </div>
  )
}

export default AdminProductCard
